$(document).ready(function(){
$('.rating').rating({
  start: 5,
  stop: 10
});

$('.rating').click(function(){
  var user_id = $(this).attr('data-user-id');
  var stars = $(this).val();

  $.ajax({
    type: 'post',
    url: '/users/' + user_id + '/rate',
    data: {rating: stars}
  }); 
});
})
